import React from 'react';
import styled from "styled-components";
import { shade, lighten } from 'polished';

export const Menu = styled.button`
    background: transparent;
    border: none;
    outline:none;
    box-shadow:none;
    cursor: pointer;

    &:active{
        .center{
            margin-top: 2.5px;
            margin-bottom: 2.5px;
        }
        background: ${props => props.theme.colors.text && lighten(0.2, props.theme.colors.text)};
    }

    div{
        width: 30px;
        height: 5px;
        background: ${props => props.theme.colors.text};
        border-radius: 2px;
    }

    .center{
        transition: .1s;
        margin-top: 5px;
        margin-bottom: 5px;
    }
`;

function Projects({ color }) {
    return (
        <Menu>
            <div className="" />
            <div className="center" />
            <div className="" />
        </Menu>
    );
}

export default Projects;
